import React from 'react';
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer,
} from 'recharts';

function TelemetryCharts({ telemetryData }) {
  if (!telemetryData || telemetryData.length === 0) {
    return <div>No telemetry data available</div>;
  }

  // Filter out data points where power or temperature is null to avoid gaps in the chart
  const filteredData = telemetryData.filter(d => d.power !== null && d.temperature !== null);

  return (
    <div>
      <h2>Telemetry Charts</h2>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart
          data={filteredData}
          margin={{
            top: 5, right: 30, left: 20, bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="timestamp" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="power" stroke="#8884d8" activeDot={{ r: 8 }} />
          <Line type="monotone" dataKey="temperature" stroke="#82ca9d" />
          <Line type="monotone" dataKey="utilization" stroke="#ffc658" />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}

export default TelemetryCharts;
